gEN(){return"A vila do Iona localiza-se na regi\xe3o sul do Namibe, uma prov\xedncia da Republica de Angola. Toda essa regi\xe3o, situada no Sul do continente Africano enfrenta uma grave desertifica\xe7\xe3o causadhepelo abate de \xe1rvores, pr\xe1ticas agr\xedcolas insustent\xe1veis, e mudan\xe7as clim\xe1ticas. A escassez de chuva e os solos \xe1ridos constituem uma amea\xe7a \xe0 vida das comunidades, que dependem da cria\xe7\xe3o de gado como parte da sua cultura e, como consequ\xeancia, t\xeam que caminhar longas dist\xe2ncias em busca de pasto. Esta situa\xe7\xe3o amea\xe7a as suas vidas de v\xe1rias formas: fracas reservas alimentares, m\xe1 nutri\xe7\xe3o, doen\xe7as e analfabetismo provocado pelo absentismo escolar em beneficio da pastoricia. \xc9 urgente que se promova a refloresta\xe7\xe3o, pr\xe1ticas agr\xedcolas sustent\xe1veis, e o acesso \xe0 \xe1gua pot\xe1vel, e por isso a Ngola precisa de ti prevenir os efeitos da Seca e apoiar a popula\xe7\xe3o do Iona a ultrapassar esses constrangimentos."},
