gEP(){return"A desfloresta\xe7ao em Angola n\xe3o acontece apenas devido a causas naturais: precisamos travar uma grande batalha, contra o abate e a queima de arvores para aumentar os campos de cultivo e para produzir carv\xe3o. Junta-te a n\xf3s para proteger as \xe1rvores e proteger \xe1reas amea\xe7adas desta desflorestacao en massa. O corte e a queima de \xe1rvores amea\xe7a o meio ambiente tem impacto direto em comunidades vulner\xe1veis. Com a tua ajuda, podemos fazer a diferen\xe7a: contribui para a nossa campanha hoje, e ajuda a proteger as Florestas enquanto apoiamos comunidades carentes. Juntos, podemos construir um futuro mais verde e sustent\xe1vel para todos."},
